//jshint esversion:6

import React, { useState } from "react";


function App() {

    var [count, setCount] = useState(1000);


    return (
      <>
        <h1>{count}</h1>
        <button type="button" onClick={() => useState(count++)}>
          Increase
        </button>
        <button onClick={() => setColor("maviiiiiiii")}> change </button>
      </>
    );

}

export default App;
